import React from 'react';

import './book-list-item.css';

const BookListItem = ({book}) => {
    const {title, author, imgLink} = book;
    return (
        <div className="container">
            <div className="row" >
                <img src={imgLink} className="col-5"/>
                <span>{title}</span>
                <br />
                <span>{author}</span>
            </div>
        </div>
    )
}

export default BookListItem;
